  by Mark Paster, a consultant to the GETEM project, to outline the improvements that
  were made between summer 2011 and spring 2013. The report focuses on six areas of
  model improvement: (1) Site Specific Cost Variability; (2) Consistency with other
  EERE Programsu2019 LCOE Approach and Methodology; (3) Risk Assessment/Cost; (4)
  Specific Data Gaps, Well Drilling Costs, Power Plant Costs; (5) Future LCOE Projections;
